import React from 'react'

export default function TextForm(props) {
  return (
    <div>
        <div class="mb-3" >
            <h1>{props.heading}</h1>
            <textarea className="form-control" id="exampleFormControlTextarea1" rows="8"></textarea>
        </div>
        <button className='buttonprimary'>Convert to uppercase</button>
    </div>
  )
}
